import React from "react"




export default function QuizPage() {

    React.useEffect(() => {
        function getTriviaQuestions() {
            fetch("https://opentdb.com/api.php?amount=10&category=31&difficulty=easy&type=multiple")
            .then(response => response.json())
            .then(data => console.log(data.results))
        }

        getTriviaQuestions()

    })



    return (
        <div>
            <Card />
            <Card />
            <Card />
            <Card />
            <Card />
            <Footer />
        </div>
    )
}

function Card() {
    return(
        <div>
            <p>How would one say goodbye in Spanish?</p>
            <button className="quizpage--button">Adios</button>
            <button className="quizpage--button">Hola</button>
            <button className="quizpage--button">Au Revior</button>
            <button className="quizpage--button">Salir</button>
        </div>
    )
}

function Footer() {
    return (
        <div>
            <h1>You scored 3/5 answers correct</h1>
            <button>Play Again</button>
        </div>
    )
}
